  `booking_id` int(255) NOT NULL AUTO_INCREMENT,
  `bunk_id` int(255) DEFAULT NULL,
  `user_id` int(255) DEFAULT NULL,
  `licenceNumber` varchar(1000) DEFAULT NULL,
  `slot_number` varchar(120) DEFAULT NULL,
